  #allMyButtons {
    position: relative;

    #shuffleButton1 {
      position: relative;
      background-repeat: no-repeat;
      text-overflow: clip;
      top: 0px;
      color: rgb(211, 218, 177);
      background-color: rgb(113, 148, 68);
      z-index: $testingInterface;
      width: $cardBackgroundSizeWidth;
      height: $cardBackgroundSizeHeight;
    }

    #shuffleButton1:hover {
      background-color: rgb(61, 104, 36);
      cursor: pointer;
    }

    #shuffleButton2 {
      background-repeat: no-repeat;

      position: relative;

      text-overflow: clip;
      top: 0px;
