        top: 0px;
        width: $cardBackgroundSizeWidth;
        height: $cardBackgroundSizeHeight;
        z-index: $allCards_index;
        padding: 0%;
      }

      #oreCard {
        background-image: url("../gameAssetsOfficial/straightenedResourcecards/oreCard.png");
        background-repeat: no-repeat;
        position: relative;

        background-size: $cardBackgroundSizeWidth $cardBackgroundSizeHeight;
        top: 0px;
        width: $cardBackgroundSizeWidth;
        height: $cardBackgroundSizeHeight;
        z-index: $allCards_index;
        padding: 0%;
      } /* end oreCard */

      #brickCard {
        background-image: url("../gameAssetsOfficial/straightenedResourcecards/brickCard.png");
        background-repeat: no-repeat;
        position: relative;

        background-size: $cardBackgroundSizeWidth $cardBackgroundSizeHeight;
        top: 0px;
